class Solution:
    def beautifulSubstrings(self, s: str, k: int) -> int:
        vowels = set("aeiou")
        n = len(s)
        count = 0
        prefix_vowels = [0] * (n + 1)
        prefix_consonants = [0] * (n + 1)

        for i in range(n):
            prefix_vowels[i + 1] = prefix_vowels[i] + (s[i] in vowels)
            prefix_consonants[i + 1] = prefix_consonants[i] + (s[i] not in vowels)

        for i in range(n):
            for j in range(i + 1, n + 1, 2):
                v_count = prefix_vowels[j] - prefix_vowels[i]
                c_count = prefix_consonants[j] - prefix_consonants[i]
                if v_count == c_count and (v_count * c_count) % k == 0:
                    count += 1

        return count
